import React from 'react';
import Firebase, { FirebaseContext } from '../firebase';

class Home extends React.Component{
    render(){
        return (
            <FirebaseContext.Consumer>
                {
                    firebase => {
                        return (
                            <div>
                                <p>Home</p>
                                <button id="signIn" onClick={firebase.doSigninWithEmail}>Sign in!</button>
                            </div>  
                        );
                    }
                }
            </FirebaseContext.Consumer>

        );
    }
}

export default Home;
